import './Navigatebar.css';

import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function Navigatebar() {
  return (
    <Navbar bg="light" variant="light">
      <Navbar.Brand href="/">AIMT</Navbar.Brand>
      {/* <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav"> */}
        <Nav className="me-auto">
          <Nav.Link href="/">Menu</Nav.Link>
          <Nav.Link href="/login">Login</Nav.Link>
          <NavDropdown title="Network Adapter" id="basic-nav-dropdown">
            <NavDropdown.Item href="/">800</NavDropdown.Item>
            <NavDropdown.Item href="/">700</NavDropdown.Item>
            <NavDropdown.Item href="/">600</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="/">All List</NavDropdown.Item>
          </NavDropdown>
        </Nav>
      {/* </Navbar.Collapse> */}
    </Navbar>
  );
}

export default Navigatebar;
